const Header = () => {
    return(
        <div className="text-center">
            <img
                src="https://cdn.worldvectorlogo.com/logos/react-2.svg"
                width="100"
                className="img-thumbnail"
                style={{marginTop: "20px"}}
                alt="logo"
            />
            <hr/>
            <h1>App for project on React + Django</h1>
        </div>
    )
}

export default Header;
